INSERT INTO `auto-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/Auto-Subwoofer/Eton RES 10 A.webp;', 'Eton RES 10 A', 'https://www.amazon.de/ETON-RES-10-Aktivsubwoofer-Reserveradwoofer/dp/B07C9CB1VM/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3LFA6NUO36K86&keywords=eton+res+10a&qid=1667236640&qu=eyJxc2MiOiIxLjgxIiwicXNhIjoiMC44MCIsInFzcCI6IjAuMjcifQ%3D%3D&sprefix=%2Caps%2C87&sr=8-3', '349,00', 4.7, 208, 1, '-;ETON;Tischplatte;Fernsteuerung;-;RCA;Subwoofer;KLEIN, PRAKTISCH, KRAFTVOLL – Das sind die Attribute des neuen RES11 Reserverad-Aktiv-Subwoofers. Einfachste Montage, versteckt im Inneren des Ersatzrades. Hochwertig gefertigt im edlen Aluminiumdruckgehäuse inklusive Kabelfernbedienung, Montagezubehör und Anschlusskabelset. Der kraftvolle Allrounder für alle die mehr wollen, ohne große Aufwendungen und ohne Platzverlust – versteckt, 100% reversibel!|11“ Reserverad-Aktiv-Subwoofer , 200W RMS / 320W MAX, Geschlossenes Aluminiumdruckgehäuse, 91 dB Wirkungsgrad|Auto sense on Funktion, Kabelfernbedienung, Plug and Play Anschlusssystem|Inkl. Montagematerial und Anschlusskabelset|360 mm x 144,5 mm');
