INSERT INTO `auto-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/Auto-Subwoofer/JBL BassPro SL2.webp;', 'JBL BassPro SL2', 'https://www.amazon.de/JBL-SUBBPSL2/dp/B07XS4PND2/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1YPU3GJDFYPEU&keywords=JBL+BassPro+SL2&qid=1667236653&qu=eyJxc2MiOiIxLjgxIiwicXNhIjoiMS4wOSIsInFzcCI6IjAuNTkifQ%3D%3D&sprefix=%2Caps%2C68&sr=8-3', '224,43', 4.7, 98, 0, '-;JBL;Flush Montage;Fernsteuerung;Für Musikabspielgeräte;Kabelgebunden;Koaxial;Untersitz Subwoofer für das Auto: der BassPro SL2 ist ein praktischer und Klangvoller mini Underseat Subwoofer - ein super flacher aktiver Subwoofer der einfach unter den Vordersitz passt und so das Soundsystem erweitert mit tiefe, satte Bässe|Aktive JBL Subwoofer Verstärker: einen kleinen aber leistungsstarken 125 Watt RMS mono 1-Kanal JBL Class-D-Digital Verstärker mit eine voll variable Frequenzweiche und ein Bass-EQ ist eingebaut, was ihn zu einer kraftvollen Lösung macht|Die Elektronische Crossover-Steuerung ermöglicht variable Anpassungen von 35Hz bis 120Hz, so dass du den BassPro SL2 aktiv Subwoofer für Auto optimal in das car Hifi Audiosystem deines Fahrzeugs integrieren kannst|Der 8"-Tieftöner ist in einem speziell kompakten Gehäuse integriert, das so konstruiert ist, dass er nur geringe Verzerrung und zugleich großartigen Bass erzeugt. Der BassPro SL2 erzeugt kaum Wärme und verbraucht wenig Energie von der Auto Anlage Set|Seine individualisierte Schalttechnik schützt den 200mm-Woofer im BassPro SL2 Auto Subwoofer Set und erzeugt bei auch bei verschiedenen Ausgangsleistungen stets die den perfekten Satter Sound. Außerdem verfügt er über Line- und High-Eingänge');
INSERT INTO `auto-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/Auto-Subwoofer/Hifonics MR 10 Dual-Subwoofer.webp;', 'Hifonics MR 10 Dual-Subwoofer', 'https://www.amazon.de/Hifonics-MR10DUAL/dp/B005ZMQLP6/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1CW10LNYMSBUY&keywords=Hifonics+MR+10+Dual-Subwoofer&qid=1667236659&qu=eyJxc2MiOiIwLjk5IiwicXNhIjoiMC4zNyIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=hifonics+mr+10+dua%2Caps%2C76&sr=8-2', '349,00', 4.0, 50, 0, 'black;Hifonics;Tischplatte;-;Für Spielkonsolen;-;Subwoofer;Musikleistung 1600 W|Die sehr kompakten Subboxen sind mit leistungsfähigen 50mm Schwingspulen und kräftigen Magnetantrieben für präzise Kick-Bässe konzipiert');
