INSERT INTO `auto-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/Auto-Subwoofer/JBL S2-1224SS.webp;', 'JBL S2-1224SS', 'https://www.amazon.de/JBL-S2-1224SS-12-Bassreflexgeh%C3%A4use-patentierter-Slipstream-Technologie-Schwarz/dp/B0189KP7S2/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3IIU0FCHZMARP&keywords=JBL+S2-1224SS&qid=1667236683&qu=eyJxc2MiOiIwLjE3IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=hifonics+zx-82a%2Caps%2C61&sr=8-3', '194,50', 4.6, 207, 0, 'black;JBL;Bodenstehend;-;-;-;Subwoofer;Der S2-1224SS Gehäuse-Subwoofer ist eine Großartige Ergänzung zum Klangerlebnis im Auto: er liefert liefert satte Bässe bei einer sehr hohe Ausgangsleistung und geringe Bassverzerrung aus ein belüftetes Gehäuse mit der patentierte Slipstream-Öffnung|Mit den High-Roll-Surrounds, dem patentierten Konusdesign und der langen Ausdehnung liefert der S2-1224SS tiefe, kraftvolle Bässe bis zu 1100 Watt mit deutlich größerer Präzision als Boxen mit Öffnungen der Konkurrenz|Die Subwoofer der Serie II verfügen über einen exklusiven SSI-Schalter (Smart Selectable Impedance); damit kannst du zwischen einer Impedanz von 2 oder 4 Ohm wählen und hast so maximale Flexibilität bei der Konfiguration. So ist der JBL Subwoofer Passiv in fast jedes Auto Soundsystem einfach zu installieren|JBL Box groß: das 12 Zoll Tieftonmembran und die große Schwingspule sorgen für einen bemerkenswerten Realismus, perfekte Präzision und eine anhaltende tiefe Basswiedergabe. Das Langhubdesign des Gehäuses der Serie II sorgt für eine große, tiefe Basswiedergabe. Genau so, wie du es magst|LEBENSDAUER: JBL Boxen und JBL Auto Subwoofer Set durchlaufen einen strengen Testprozess, der viele andere Auto Lautsprecher zerstören würde. JBL friert sie ein, backt sie, schüttelt sie, bestrahlt sie mit ultraviolettem Licht und betreibt sie tagelang mit voller Leistung');
INSERT INTO `auto-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (9, '../img/products/Auto-Subwoofer/Axton ATB25P.webp;', 'Axton ATB25P', 'https://www.amazon.de/AXTON-ATB25P-kompakter-Untersitzbass-Verst%C3%A4rker/dp/B01C08C8U4/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1I6BKR73QTBS&keywords=Axton+ATB25P&qid=1667236690&qu=eyJxc2MiOiIxLjAyIiwicXNhIjoiMC41NyIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=jbl+s2-1224ss%2Caps%2C94&sr=8-2', '215,00', 4.5, 150, 0, '-;Axton;Tischplatte;Fernsteuerung;Auto;RCA;Subwoofer;In etwa so groß wie eine DIN A4 Seite, lässt sich dieser kompakte Untersitz Subwoofer fast überall im Auto verbauen – auch unter dem Fahrer- oder Beifahrersitz.|Der edel designte Aktivsubwoofer ist ein optimaler Partner, wenn bassarmen Soundsystemen mehr Power verliehen werden soll. Da sich die Bassbox schnell ein- und ausbauen lässt, eignet sie sich auch für Leasingfahrzeuge, an denen möglichst wenig verändert werden soll.|Der aktive Underseat Gehäusesubwoofer nutzt zwei Passivmembranen, die dem ATB25P zu deutlich satterem, kräftigerem Bass verhelfen. Angetrieben wird das System durch einen potenten 25 cm / 10“ Woofer und ein sehr hochwertiges Class A/B Verstärkermodul.|Der ultrakompakte Sub hat alle notwendigen Einstelloptionen an Bord. Dazu gehören ein Tiefpassfilter, ein Subsonicfilter, Bass-Boost, Phase Shift sowie ein High-Level Eingang mit Auto Turn-On Funktion.|Abmessungen (L x B x H): 345 x 245 x 81 mm, Ausgangsleistung 4 Ohm: 1 x 180 W RMS, Basspegel-Fernbedienung im Lieferumfang');
INSERT INTO `auto-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (10, '../img/products/Auto-Subwoofer/Pioneer TS-WX70DA.webp;', 'Pioneer TS-WX70DA', 'https://www.amazon.de/Pioneer-TS-WX70DA-Platzsparender-integrierter-Bass-Regelung/dp/B01MY9VZ7N/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1CAC1J12J7G7N&keywords=Pioneer+TS-WX70DA&qid=1667236696&qu=eyJxc2MiOiIxLjAyIiwicXNhIjoiMC4yNSIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C68&sr=8-2', '339,99', 4.2, 125, 0, 'black;Pioneer;Tischplatte;Fernsteuerung;Musik,Auto;RCA;Subwoofer;HIGH PERFORMANCE: TS-WX70DA Pioneer Woofer mit Cinch- und Lautsprechereingang - Profitieren Sie von überzeugender Pioneer Qualität rund um Sound und genießen erstklassigen Musikgenuss|STARKER SOUND: Durch den eingebauten Klasse D Verstärker und der integrierten digitalen Bass Regelung, garantiert der Pioneer Subwoofer kraftvolle und präzise Basswiedergabe|BEEINDRUCKENDES KLANGERLEBNIS: Der Auto Subwoofer verfügt über zwei frei wählbare Bassmodi: TIEF und DYNAMISCH - für einen 200 Watt starken und tiefen Bass|BEDIENERFREUNDLICH: Neben dem Montagezubehör befindet sich eine Kabelfernbedienung im Lieferumfang, um bequem vom Fahrersitz aus, den Class D Subwoofer zu kontrollieren und anzupassen|KOMPAKT: Das ultraflache und kratzfeste Gehäuse des Auto aktiv Subwoofers verspricht eine platzsparende Montage im Kofferraum ohne viel Raum einzubüßen');
INSERT INTO `auto-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (11, '../img/products/Auto-Subwoofer/Jbl Basspro Nano.webp;', 'Jbl Basspro Nano', 'https://www.amazon.de/JBL-SUBBPNANO/dp/B07YBPHBWX/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2TBEJINSUJSWA&keywords=Jbl+Basspro+Nano&qid=1667236703&qu=eyJxc2MiOiIxLjIwIiwicXNhIjoiMC4zNyIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C68&sr=8-2', '172,25', 4.6, 178, 0, 'black;JBL;Bodenstehend;Fernbedienung;Musik;RCA;Subwoofer;Der BassPro NANO Auto-Subwoofer von JBL mit eingebautem Verstärker liefert tiefe Bässe und nimmt nur wenig Platz ein. JBLs kleinster aktiver Auto-Subwoofer kann an den kompaktesten Stellen versteckt werden wie unter dem sitz und liefert außergewöhnliche Leistung für jedes Car hifi System|Angetrieben von einem 100Watt RMS Subwoofer-Verstärker, liefert der BassPro Nano druckvolle, straffe Bässe, die du von JBL erwarten würdest, während er kühl läuft und nur minimalen Strom aus dem Ladesystem deines Fahrzeugs zieht|Der BassPro Nano verwendet Hochpassfilter und Limiter, die eine außergewöhnliche At-the-Limits-Performance liefern, damit du die Musik mit dem vom Musiker beabsichtigten Bass-Erlebnis genießen kannst|Der kleine Formfaktor des robusten Voll-Aluminium-Druckguss-Gehäuses minimiert nicht nur die Größe, sondern eliminiert auch Rasseln, um klare Bässe auf kleinstem Raum zu liefern|JBL Subwoofer und Lautsprecher müssen einen strengen Testprozess durchlaufen. JBL friert sie ein, backt sie, schüttelt sie, bestrahlt sie mit ultraviolettem Licht und betreibt sie tagelang mit voller Leistung');
INSERT INTO `auto-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (12, '../img/products/Auto-Subwoofer/Pioneer TS-WX300A.webp;', 'Pioneer TS-WX300A', 'https://www.amazon.de/Pioneer-TS-WX300A-Aktiver-Geh%C3%A4usesubwoofer-Kofferraum/dp/B077ZC9TDB/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3GFJ0ECS0FTS9&keywords=Pioneer+TS-WX300A&qid=1667236709&qu=eyJxc2MiOiIwLjg1IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=jbl+basspro+nano%2Caps%2C117&sr=8-2', '152,22', 4.4, 551, 0, '-;Pioneer;Tischplatte;Fernsteuerung;Für Musikabspielgeräte;-;Woofer;PolyimideMerrite Magnets|Maximum input power 1300 W|Rated input power 350 W|Frequency response 20 - 130 Hz|113 dB sensitivity');
